Actionscript.script:
import flash.display.Graphics;
import flash.display.Sprite;
import flash.display.Shape;
import flash.events.MouseEvent;

var s:Sprite = new Sprite();
this.addChild(s);
var gfx:Graphics = s.graphics;

gfx.lineStyle(5, 0xff00ff);
gfx.moveTo(10, 10);
gfx.lineTo(110, 10);
gfx.lineTo(110, 110);
gfx.lineTo(10, 110);

gfx.moveTo(120, 10);
gfx.lineTo(220, 110);

gfx.moveTo(90, 30);
gfx.lineTo(90, 90);
gfx.lineTo(30, 90);
gfx.lineTo(30, 30);

gfx.lineStyle(5, 0x77aa33);
gfx.moveTo(120, 10);
gfx.lineTo(220, 10);
gfx.lineTo(220, 110);
gfx.lineTo(120, 110);

gfx.moveTo(200, 30);
gfx.lineTo(140, 30);
gfx.lineTo(140, 90);
gfx.lineTo(200, 90);

gfx.moveTo(240, 10);
gfx.lineTo(340, 10);
gfx.lineStyle(5, 0xff00ff);
gfx.lineTo(340, 110);
gfx.lineStyle(5, 0x77aa33);
gfx.lineTo(240, 110);
gfx.lineStyle(5, 0xff00ff);

gfx.drawRoundRect(360, 10, 100, 100, 30, 20);

gfx.drawCircle(60, 170, 50);
gfx.drawCircle(60, 170, 35);

gfx.drawEllipse(140, 120, 60, 100);

gfx.moveTo(10, 240);
gfx.lineTo(80, 240);
gfx.curveTo(135, 280, 80, 340);
gfx.curveTo(50, 280, 10, 340);

gfx.moveTo(120, 240);
gfx.lineTo(220, 240);
gfx.cubicCurveTo(275, 273, 175, 306, 220, 340);
gfx.cubicCurveTo(187, 370, 153, 290, 120, 340);


