s.buttonMode = true;
s.useHandCursor = true;

var indicator:Shape = new Shape();
addChild(indicator);
indicator.graphics.beginFill(0x0);
indicator.graphics.drawCircle(0, 0, 10);
indicator.x = 500;
indicator.y = 350;
indicator.visible = false;

addEventListener(MouseEvent.MOUSE_OVER, function(e) {indicator.visible = true});
addEventListener(MouseEvent.MOUSE_OUT, function(e) {indicator.visible = false});
